import React, { useState, useEffect } from 'react';

const DassQuiz = () => {
  const [patientData, setPatientData] = useState(null);
  const [answers, setAnswers] = useState({
    d1: 0, d2: 0, d3: 0, d4: 0, d5: 0, d6: 0, d7: 0,
    a1: 0, a2: 0, a3: 0, a4: 0, a5: 0, a6: 0, a7: 0,
    s1: 0, s2: 0, s3: 0, s4: 0, s5: 0, s6: 0, s7: 0
  });
  const [error, setError] = useState(null);

  // Fetch patient data from localStorage
  useEffect(() => {
    const patient = JSON.parse(localStorage.getItem('patient'));

    if (patient) {
      setPatientData(patient);
    } else {
      setError('No patient data found.');
    }
  }, []);

  // Handle change in answer selection
  const handleChange = (e) => {
    setAnswers({
      ...answers,
      [e.target.name]: parseInt(e.target.value)
    });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Submitted answers:', answers);
    alert("Your DASS-21 answers have been submitted!");
  };

  return (
    <div className="dass-quiz-container">
      {error && <h4 className="error">{error}</h4>}

      <h2 className="heading">DASS-21 Quiz</h2>

      <p className="patient-name">
        {patientData ? `Welcome, ${patientData.fullname}!` : 'Loading patient data...'}
      </p>

      <form onSubmit={handleSubmit}>
        <h3>Depression Scale (D)</h3>
        <div className="input-container">
          <label>1. I found it hard to wind down</label>
          <input type="number" name="d1" value={answers.d1} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>2. I was aware of dryness of my mouth</label>
          <input type="number" name="d2" value={answers.d2} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>3. I couldnâ€™t seem to experience any positive feeling at all</label>
          <input type="number" name="d3" value={answers.d3} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>4. I experienced breathing difficulty (e.g. excessively rapid breathing)</label>
          <input type="number" name="d4" value={answers.d4} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>5. I found it difficult to work up the initiative to do things</label>
          <input type="number" name="d5" value={answers.d5} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>6. I tended to over-react to situations</label>
          <input type="number" name="d6" value={answers.d6} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>7. I experienced trembling (e.g. in the hands)</label>
          <input type="number" name="d7" value={answers.d7} onChange={handleChange} min="0" max="3" />
        </div>

        <h3>Anxiety Scale (A)</h3>
        <div className="input-container">
          <label>1. I was worried about situations in which I might panic</label>
          <input type="number" name="a1" value={answers.a1} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>2. I was aware of the action of my heart (e.g. sense of heart rate increase)</label>
          <input type="number" name="a2" value={answers.a2} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>3. I felt I was close to panic</label>
          <input type="number" name="a3" value={answers.a3} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>4. I experienced difficulty breathing</label>
          <input type="number" name="a4" value={answers.a4} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
          <label>5. I felt scared without any good reason</label>
          <input type="number" name="a5" value={answers.a5} onChange={handleChange} min="0" max="3" />
        </div>
        <div className="input-container">
